import React, { Component } from 'react';

import './App.css';

import PressKey from './components/PressKey';
import DisplayScreen from './components/DisplayScreen';

class App extends Component {
  constructor(){
    super();
    this.state = {
      result : ''
    }
  }

  render() {
    const displayLetters = [
      '(', ')', '%', 'AC', '7', '8', '9', '/', '4', '5', '6', '*', '1', '2', '3', '-', '0', '.', '=', '+'
    ]

    const pressKeyItems = displayLetters.map((displayLetter) =>
      <PressKey key={displayLetter.toString()} value={displayLetter}>
      </PressKey>
    );

    return (
      <div>
        <DisplayScreen value="1+"></DisplayScreen>
        {pressKeyItems}
      </div>
    )
  }
}


export default App;
